import React from 'react';
import { Carousel, Col, Container, Row } from 'react-bootstrap';
import { FaGithub, FaPodcast, FaArrowRight } from 'react-icons/fa';
import project1 from '../../../images/pj.png';
import './Projects.css';

const Projects = () => {
    return (
        <div className="project-section">
            <Container>
                <div className="text-center">
                    <h2 className="title">My Portfolio</h2>
                </div>
                <Row>
                    <Col md={4}>
                        <div className="project-card">
                            <img className="img-fluid project-img" src={project1} alt="Project_Image" />
                            <div className="img-container h-100">
                                <div>
                                    <h4 className="project-title">GOMOTO</h4>
                                    <div className="d-flex">
                                        <button className="project-btn">Details <FaArrowRight className="ms-2" /></button>
                                        <a className="text-decoration-none" href="https://assignment-11-816e9.web.app/" target="_blank">
                                            <button className="project-btn">Live Link <FaPodcast className="ms-2" /></button>
                                        </a>
                                        <a className="text-decoration-none" href="https://github.com/atikuljaman/GOMOTO-Food-Delivery-Website" target="_blank">
                                            <button className="project-btn">Github <FaGithub className="ms-2" /></button>
                                        </a>

                                    </div>
                                </div>
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Projects;



